<template>
<div class="myqrcode page" :class="{page_img: page_img}">
<!-- <BScroll 	class="box_wrapper" ref="scroll" >
<div> -->

<div id="haibao" class="qrcode_wrapper" v-show="dom">
	<img src="data:image/jpeg;base64," width="100%" style="z-index: -1;">
	<div class="qrcode_box">	
		<div id="qrcode" class="qrcode" ref="qrcode"></div>
	</div>
</div>
	<div class="crea_btn" @click=created_img v-show="dom">生成图片按钮</div>

<img :src=dataURL width="100%">
<!-- </div></BScroll> -->
</div>
</template>

<script>
import BScroll from '@/components/base/scroll/scroll'
import QRCode from 'qrcodejs2'

var from_url = '';
export default {
	name:"myqrcode",
	data() {
		return {
			qrcode_url:"baidu.com",
			dom: true,
			page_img:false,
			dataURL:'',
		}
	},
	mounted() {
		console.log(from_url)
		// this.$loading.show('正在生成');
  	this.$nextTick(() => {
  	    this.qrcode()
  	})
	},
	methods:{
		qrcode() {  
			let that = this
			let qrcode = new QRCode('qrcode', {  
	      width: 120,  
	      height: 120, // 高度  
	      
	     text: this.qrcode_url, // 二维码内容
	     //  image: '',  
	      // render: 'canvas' // 设置渲染方式（有两种方式 table和canvas，默认是canvas）  
	      background: '#ffffff', 
	     	foreground: "#ffffff"
	    })  			
      console.log(qrcode)  
  	},
  	created_img() {
  		let that = this
  		document.documentElement.scrollTop = document.body.scrollTop = 0;
  		this.page_img= true
  		html2canvas(document.getElementById('haibao')).then(function(canvas) {
          // document.body.appendChild(canvas);
          that.dataURL = canvas.toDataURL("image/jpeg");
          that.dom = false
          that.$loading.hide();
          that.$toast("生成图片成功,长按保存")
      });
  	}
	},
	components: {
		BScroll
	},
	beforeRouteEnter (to, from, next) {
		from_url = from.fullPath
		next()
	}
}
</script>

